// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

interface AgregatorConsumerInterface {
    function getLatestRate()
        external
        returns (
            uint256,
            uint256,
            string memory,
            uint256 date
        );
}

interface PoolConsumerInterface {
    function PoolRate()
        external
        returns (
            uint256,
            uint256,
            string memory,
            uint256 date
        );
}

interface IERC20Burnable is IERC20 {
    function burn(uint256 amount) external;

    function symbol() external returns (string memory);
}

// TODO event logs are needed!!!
// TODO fix function visibility
contract PtrnEcoSystemParticipation is Pausable, Ownable {
    address private acceptedSenderAddress;
    address private immutable ACTIVATOR;
    bool poolRateFeed = true;

    AgregatorConsumerInterface agregatorConsumer;
    PoolConsumerInterface poolConsumer;

    uint256 private totalBurned = 0;
    uint256 private totalConverted = 0;
    uint256 private availableToWithdraw = 0;
    uint256 private dailyWithdraw = 0;

    // struct HistoryData {
    //     uint256 chargeRate;
    //     uint256 chargeRatedecimals;
    //     uint256 chargeRateDate;
    //     string chargeRateString;
    //     uint256 chargedPoints;
    //     uint256 burnedTokens;
    //     uint256 chargeDate;
    // }

    // HistoryData[3] private historyDataArray;
    // uint256 private currentIndex = 0;
    IERC20Burnable private immutable TOKEN;
    string tokenSymbol;

    modifier onlyAuthorized() {
        require(msg.sender == acceptedSenderAddress, "Not Authorized!");
        _;
    }

    modifier activated() {
        require(acceptedSenderAddress != address(0), "Not activated.");
        _;
    }

    modifier onlyOwnerOrAuthorized() {
        require(
            (msg.sender == acceptedSenderAddress || msg.sender == owner()),
            "Only Owner or Authorized participator!"
        );
        _;
    }

    // remove keep data in contract
    event ChargeContract(
        uint256 chargeRate,
        uint256 chargeRatedecimals,
        uint256 chargeRateDate,
        string chargeRateString,
        uint256 indexed chargedPoints,
        uint256 indexed burnedTokens,
        uint256 indexed chargeDate
    );

    constructor(address _acceptedTokens, address _activator) {
        ACTIVATOR = _activator;
        TOKEN = IERC20Burnable(_acceptedTokens);
        tokenSymbol = TOKEN.symbol();
    }

    function activate() public whenNotPaused {
        require(ACTIVATOR == msg.sender, "Can't activate with this address!");
        require(acceptedSenderAddress == address(0), "Already activated.");
        acceptedSenderAddress = msg.sender;
    }

    function deactivate() public activated onlyAuthorized whenNotPaused {
        acceptedSenderAddress = address(0);
    }

    function changeAcceptedSenderAddress(address newAcceptedSender)
        public
        activated
        onlyAuthorized
        activated
    {
        require(newAcceptedSender != address(0));
        acceptedSenderAddress = newAcceptedSender;
    }

    function stop() public whenNotPaused onlyOwner {
        // ensure no money inside
        _pause();
    }

    function resume() public whenPaused onlyOwner {
        _unpause();
    }

    // function addHistoryData(
    //     uint256 _chargeRate,
    //     uint256 _chargeRatedecimals,
    //     uint256 _chargeRateDate,
    //     string memory _chargeRateString,
    //     uint256 _chargedPoints,
    //     uint256 _burnedTokens,
    //     uint256 _chargeDate
    // ) private {
    //     HistoryData memory newHistoryData = HistoryData({
    //         chargeRate: _chargeRate,
    //         chargeRatedecimals: _chargeRatedecimals,
    //         chargeRateDate: _chargeRateDate,
    //         chargeRateString: _chargeRateString,
    //         chargedPoints: _chargedPoints,
    //         burnedTokens: _burnedTokens,
    //         chargeDate: _chargeDate
    //     });

    //     historyDataArray[currentIndex] = newHistoryData;

    //     // Update the currentIndex to point to the next index,
    //     // or reset it to 0 if it has reached the end of the array.
    //     currentIndex = (currentIndex + 1) % 3;
    // }

    function changeRateFeed() public onlyOwner {
        poolRateFeed = !poolRateFeed;
    }

    function currentRateFeed() public view onlyOwner returns (string memory) {
        string memory result;
        poolRateFeed ? result = "Pool" : result = "AggregatorV3";
        return result;
    }

    function addNewAgregatorPriceFeed(address _ConsumerInterfaceAddress)
        public
        onlyOwner
    {
        agregatorConsumer = AgregatorConsumerInterface(
            _ConsumerInterfaceAddress
        );
    }

    function addNewPoolRateFeed(address _ConsumerInterfaceAddress)
        public
        onlyOwner
    {
        poolConsumer = PoolConsumerInterface(_ConsumerInterfaceAddress);
    }

    // For prod
    // function getRate() private returns (bool) {
    //     //require(poolRateFeed && (address(poolConsumer) != address(0)), "PoolConsumer is not initialized");
    //     //require(poolRateFeed && (address(agregatorConsumer) != address(0)), "AgregatorConsumer is not initialized");
    //     (uint256 rate, uint256 decimals, string memory rateString, uint256 date) =
    //         !poolRateFeed ? agregatorConsumer.getLatestRate() : poolConsumer.PoolRate();

    //     rateData.tokenRate = rate;
    //     rateData.decimals = decimals;
    //     rateData.tokenRateString = rateString;
    //     rateData.date = date;
    //     rateData.feed = poolRateFeed ? "Pool" : "AgregatorV3";

    //     return true;
    // }

    // JUST FOR TESTING
    function getRate()
        private
        pure
        returns (
            uint256,
            uint256,
            string memory,
            uint256
        )
    {
        //require(poolRateFeed && (address(poolConsumer) != address(0)), "PoolConsumer is not initialized");
        //require(poolRateFeed && (address(agregatorConsumer) != address(0)), "AgregatorConsumer is not initialized");
        // (uint256 rate, uint256 decimals, string memory rateString, uint256 date) =
        //     !poolRateFeed ? agregatorConsumer.getLatestRate() : poolConsumer.PoolRate();
        // directly get rate

        return (11111111, 8, "fakeUSDT/DummyPTRN", 1700135082);
    }

    // TODO - needs validation
    function calculatePoints(
        uint256 amount,
        uint256 rate,
        uint256 decimals
    ) private pure returns (uint256) {
        uint256 resultIn26Decimals = amount * rate;
        return resultIn26Decimals / 10**decimals;
    }

    // TODO - needs validation Ensures only checking function
    function calculateAmount(
        uint256 points,
        uint256 rate,
        uint256 _decimals
    ) public view activated onlyOwnerOrAuthorized returns (uint256) {
        require(rate > 0, "Rate must be greater than zero");
        uint256 amountIn26Decimals = points * 10**_decimals;
        return amountIn26Decimals / rate;
    }

    function chargeContract(uint256 amount)
        public
        whenNotPaused
        activated
        onlyAuthorized
        returns (bool)
    {
        require(amount > 0, "No charge ammount!");
        uint256 allowance = TOKEN.allowance(msg.sender, address(this));
        require(
            allowance >= amount,
            string.concat("Check the ", tokenSymbol, " token ", "allowance.")
        );
        TOKEN.transferFrom(msg.sender, address(this), amount);
        // set the rate
        (
            uint256 rate,
            uint256 decimals,
            string memory chargeRateString,
            uint256 chargeRateDate
        ) = getRate();
        // (11111111, 8, "fakeUSDT/DummyPTRN",1700135082,a)
        burnIncomingTokens(amount);
        uint256 points = calculatePoints(amount, rate, decimals);
        availableToWithdraw += points;
        totalConverted += points;
        // maybe not needed!!!
        // addHistoryData(
        //     rate,
        //     decimals,
        //     chargeRateDate,
        //     chargeRateString,
        //     points,
        //     amount,
        //     block.timestamp
        // );
        // Need timestamp from chainlink!!!
        uint256 chargeTime=block.timestamp;
        emit ChargeContract(rate,decimals,chargeRateDate,chargeRateString,points,amount,chargeTime);
        return (true);
    }

    function balanceOf() public view onlyOwner returns (uint256) {
        return TOKEN.balanceOf(address(this));
    }

    function withdraw(uint256 value) public onlyOwner {
        require(
            value <= availableToWithdraw - dailyWithdraw,
            string.concat(
                "Not enough points. The contract must be charged with more ",
                tokenSymbol
            )
        );
        require(value > 0, "Withdraw value must be greater than 0");
        dailyWithdraw += value;
    }

    function initiateBulkMint() public onlyOwner {
        require(dailyWithdraw > 0, "Nothing to withdraw.");
        require(
            availableToWithdraw - dailyWithdraw > 0,
            "Not enugh balance for withdraw!"
        );
        availableToWithdraw -= dailyWithdraw;
        dailyWithdraw = 0;
    }

    // check balance of tokens sent by mistake
    function balanceOfToken(address tokenAddress)
        public
        view
        onlyOwner
        returns (uint256)
    {
        return IERC20(tokenAddress).balanceOf(address(this));
    }

    // need check balance and other validation
    function transferOfToken(
        address tokenAddress,
        address receiver,
        uint256 amount
    ) public onlyOwner returns (bool) {
        require(balanceOfToken(tokenAddress) >= amount, "Not enough balance!");
        return IERC20(tokenAddress).transfer(receiver, amount);
    }

    function burnIncomingTokens(uint256 amount) private returns (bool) {
        require(amount > 0, "No tokens to be burned!");
        TOKEN.burn(amount);
        totalBurned += amount;
        return true;
    }

    // function getChargeHistory(uint256 index)
    //     public
    //     view
    //     activated
    //     onlyOwnerOrAuthorized
    //     returns (
    //         uint256,
    //         uint256,
    //         uint256,
    //         string memory,
    //         uint256,
    //         uint256,
    //         uint256
    //     )
    // {
    //     require(
    //         historyDataArray.length >= index + 1,
    //         "Index is greater than history length."
    //     );
    //     require(
    //         historyDataArray[index].burnedTokens != 0,
    //         "No data at this slot."
    //     );
    //     return (
    //         historyDataArray[index].chargeRate,
    //         historyDataArray[index].chargeRatedecimals,
    //         historyDataArray[index].chargeRateDate,
    //         historyDataArray[index].chargeRateString,
    //         historyDataArray[index].chargedPoints,
    //         historyDataArray[index].burnedTokens,
    //         historyDataArray[index].chargeDate
    //     );
    // }

    function getTotalBurnedTokens()
        public
        view
        activated
        onlyOwnerOrAuthorized
        returns (uint256)
    {
        return totalBurned;
    }

    function getTotalPointsGenerated()
        public
        view
        activated
        onlyOwnerOrAuthorized
        returns (uint256)
    {
        return totalConverted;
    }

    function getCurrentPointsBalance()
        public
        view
        activated
        onlyOwnerOrAuthorized
        returns (uint256)
    {
        return availableToWithdraw;
    }

    function getDailyWithdraw()
        public
        view
        activated
        onlyOwnerOrAuthorized
        returns (uint256)
    {
        return dailyWithdraw;
    }

    function getAcceptedSenderAddress()
        public
        view
        activated
        returns (address)
    {
        return acceptedSenderAddress;
    }

    function getInitialActivationAddress() public view returns (address) {
        return ACTIVATOR;
    }

    function getTokenInfo()
        public
        view
        onlyOwnerOrAuthorized
        returns (address, string memory)
    {
        return (address(TOKEN), tokenSymbol);
    }
}

